BEGIN TRY

  BEGIN TRANSACTION

      MERGE  dbo.PlayerRegister AS TARGET
          USING #playerRegister AS SOURCE
          ON(TARGET.Identifier = SOURCE.Identifier)
              WHEN MATCHED AND TARGET.CricInfoId <> SOURCE.CricInfoId
              THEN
                  UPDATE
                  SET TARGET.CricInfoId = SOURCE.CricInfoId
              WHEN NOT MATCHED BY TARGET
              THEN
                  INSERT(Identifier
                        , UniqueName
                        , Names
                        , CricInfoId
                        , IsActive)
                  VALUES(SOURCE.Identifier
                        , SOURCE.UniqueName
                        , SOURCE.Names
                        , SOURCE.CricInfoId
                        , SOURCE.IsActive);

  COMMIT TRANSACTION
PRINT 'MERGE dbo.playerRegister - Done'
END TRY
BEGIN CATCH
      ROLLBACK TRANSACTION;
      THROW
END CATCH
